//SPDX-License-Identifier: RahulPanchal-15
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract ChessGame {
    using SafeMath for uint256;
    using Address for address payable;

    event GameResult(
        uint256 _gameId,
        Sides _winner,
        uint256 _blackPool,
        uint256 _whitePool
    );

    event RewardedPlayers(uint256 _gameID, Sides _side);

    enum Result {
        NA,
        WinLoss,
        Draw
    }

    enum State {
        InProgress,
        Ended
    }

    enum Sides {
        None,
        White,
        Black
    }

    uint16 public MAX_CHANCES;
    bool public COLLECT;
    bool public REWARD_SET;
    uint256 public GAME_ID;
    uint256 private REWARD;
    uint256 public MIN_BID;
    uint256 public MEDIUM_BID;
    uint256 public MAX_BID;
    uint16 public totalMoves = 0;
    address payable public CHESS_FACTORY;
    Sides public turn = Sides.White;
    Sides public winner = Sides.None;
    Sides public loser = Sides.None;
    State public state = State.InProgress;
    Result public GAME_RESULT = Result.NA;
    mapping(address => Sides) public side;
    mapping(address => uint16[]) public moves;
    mapping(uint16 => bytes8) public moveId;
    mapping(Sides => uint256) public pool;
    mapping(Sides => address[]) public playersOnSide;
    mapping(Sides => uint256) public numberOfPlayers;
    mapping(Sides => mapping(address => uint256)) public bids;

    receive() external payable {}

    fallback() external payable {}

    constructor(
        uint256 _gameId,
        uint16 _maxChances,
        uint256 _minBid,
        uint256 _mediumBid,
        uint256 _maxBid,
        address payable _chessFactory
    ) {
        GAME_ID = _gameId;
        MAX_CHANCES = _maxChances;
        MIN_BID = _minBid;
        MEDIUM_BID = _mediumBid;
        MAX_BID = _maxBid;
        CHESS_FACTORY = _chessFactory;
    }

    modifier isTrueSide(Sides _side) {
        if (moves[msg.sender].length > 0) {
            require(
                side[msg.sender] == _side,
                "ChessGame: You cannot change sides!"
            );
        } else {
            side[msg.sender] = _side;
            playersOnSide[_side].push(msg.sender);
            numberOfPlayers[_side]++;
        }
        _;
    }

    modifier validBid() {
        require(
            msg.value == MIN_BID ||
                msg.value == MEDIUM_BID ||
                msg.value == MAX_BID,
            "ChessGame: Invalid Bid!"
        );
        _;
    }

    modifier onlyFactory() {
        require(
            msg.sender == CHESS_FACTORY,
            "ChessGame: Only ChessFactory can call this function!"
        );
        _;
    }

    function getNumberMoves() public view returns (uint16) {
        return uint16(moves[msg.sender].length);
    }

    function setReward(uint256 _reward) external onlyFactory {
        REWARD_SET = true;
        REWARD = _reward;
    }

    function openEscrow(bool _escrow) external onlyFactory {
        COLLECT = _escrow;
    }

    modifier hasChancesLeft() {
        require(
            getNumberMoves() < MAX_CHANCES,
            "ChessGame: You have played maximum chances!"
        );
        _;
    }

    modifier isTrueTurn(Sides _side) {
        require(_side == turn, "ChessGame: Not your turn!");
        _;
    }

    modifier rewardIsSet() {
        require(REWARD_SET, "ChessGame: Reward has not been set!");
        _;
    }

    modifier inProgress() {
        require(state == State.InProgress, "ChessGame: Game ended!");
        _;
    }

    modifier isEnded() {
        require(state == State.Ended, "ChessGame: Game in Progress!");
        _;
    }

    modifier isTrueAccount(address payable _payee) {
        require(
            _payee == msg.sender,
            "ChessGame: Use account used in game to Withdraw rewards!"
        );
        _;
    }

    modifier hasPlayedThisGame() {
        require(
            side[msg.sender] == Sides.Black || side[msg.sender] == Sides.White,
            "ChessGame: You have not played this Game!"
        );
        _;
    }

    modifier escrowIsOpen() {
        require(
            COLLECT == true,
            "ChessGame: Game in progress. Wait for game to end!"
        );
        _;
    }

    function switchTeam(Sides _side) internal pure returns (Sides) {
        if (_side == Sides.Black) {
            return Sides.White;
        } else {
            return Sides.Black;
        }
    }

    function getNumberOfPlayers(Sides _side)
        public
        view
        isEnded
        returns (uint256)
    {
        return numberOfPlayers[_side];
    }

    function performMove(
        Result _result,
        Sides _side,
        bytes8 _move
    )
        public
        payable
        inProgress()
        validBid()
        isTrueSide(_side)
        isTrueTurn(_side)
        hasChancesLeft()
    {
        totalMoves++;
        bids[_side][msg.sender] += msg.value;
        pool[_side] += msg.value;
        moveId[totalMoves] = _move;
        moves[msg.sender].push(totalMoves);
        if (_result == Result.NA) {
            turn = switchTeam(_side);
        } else {
            GAME_RESULT = _result;
            state = State.Ended;
            if (_result == Result.WinLoss) {
                winner = _side;
                loser = switchTeam(_side);
            }
            emit GameResult(
                GAME_ID,
                _side,
                pool[Sides.Black],
                pool[Sides.White]
            );
        }
    }

    function collectRewards(address payable _player)
        public
        escrowIsOpen
        hasPlayedThisGame()
    {
        Sides _playerSide = side[_player];
        require(
            _playerSide == winner || GAME_RESULT == Result.Draw,
            "ChessGame: You did not win!"
        );
        uint256 _playerBid = bids[_playerSide][_player];
        uint256 _amount = REWARD.add(_playerBid);
        Address.sendValue(_player, _amount);
    }

    function rewardPlayersOfSide(Sides _side) internal isEnded rewardIsSet {
        uint256 recipients = getNumberOfPlayers(_side);
        for (uint256 i = 0; i < recipients; i++) {
            address payable recipient = payable(playersOnSide[_side][i]);
            uint256 _playerBid = bids[_side][recipient];
            uint256 amount = REWARD.add(_playerBid);
            Address.sendValue(recipient, amount);
        }
    }

    function sendRewards() external isEnded onlyFactory rewardIsSet {
        if (GAME_RESULT == Result.Draw) {
            rewardPlayersOfSide(Sides.Black);
            emit RewardedPlayers(GAME_ID, Sides.Black);
            rewardPlayersOfSide(Sides.White);
            emit RewardedPlayers(GAME_ID, Sides.Black);
        } else if (GAME_RESULT == Result.WinLoss) {
            rewardPlayersOfSide(winner);
            emit RewardedPlayers(GAME_ID, winner);
        }
    }
}
